Insert into BSPACE_COURSE_INFO_VW (TERM_YR,TERM_CD,COURSE_CNTL_NUM,DEPT_NAME,CATALOG_ID,CATALOG_PREFIX,CATALOG_ROOT,CATALOG_SUFFIX_1,CATALOG_SUFFIX_2,PRIMARY_SECONDARY_CD,SECTION_NUM,COURSE_TITLE,LOWER_RANGE_UNIT,UPPER_RANGE_UNIT,VARIABLE_UNIT_CD,FIXED_UNIT,INSTRUCTION_FORMAT,CRED_CD,ENROLL_LIMIT,CROSS_LISTED_FLAG,INSTR_FUNC,SCHEDULE_PRINT_CD,SECTION_CANCEL_FLAG,COURSE_TITLE_SHORT,CATALOG_DESCRIPTION,COURSE_OPTION,DEPT_DESCRIPTION) values (2012,'D',31027,'ETH STD','41AC',null,41,'A','C','S','103','A Comparative Survey of Protest Movements Since the 60''s',0,0,null,0,'DIS',null,30,null,'2',null,null,'SURVEY PROTEST MOVE','An introductory, comparative, and interdisciplinary study of Native American, Mexican American, African American, and Asian American social and political struggles from 1960 to the present. The course traces the development of protest movements created by people of color in response to racial, class, gender, and political inequality in the context of U.S. politics and history. The course critically examines the internal and external factors contributing to the rise and fall of social and political movements and concludes with an analysis of the current conjuncture of race, ethnicity, culture, class, gender, and sexual preference in U.S. politics.','A1','Ethnic Studies');
